sys_variable_value.value:
(function execute(inputs, outputs) {
  var retroSysId  = inputs.retroSysId;
  var sprintSysId = inputs.sprintSysId;
  var submittedBy = inputs.submittedBy;
  var text        = inputs.startText || '';
  var tasksCreated = 0;

  // No START items → nothing to do
  if (!text.trim()) {
    outputs.tasks_created = 0;
    return;
  }

  var lines = ('' + text).split('\n');
  for (var i = 0; i < lines.length; i++) {
    var line = ('' + lines[i]).trim();
    if (!line)
      continue;

    var taskGR = new GlideRecord('x_1865669_retrospe_retrospective_task');
    taskGR.initialize();
    taskGR.setValue('retro_submission', retroSysId);
    taskGR.setValue('sprint', sprintSysId);
    taskGR.setValue('short_description', line.substring(0, 160));
    taskGR.setValue('description', line);
    taskGR.setValue('category', 'start');    // only START
    taskGR.setValue('state', '100');         // Pending
    taskGR.setValue('assigned_to', submittedBy);
    taskGR.insert();
    tasksCreated++;
  }

  // Optionally, move retro to completed / reviewed
  var retroGR = new GlideRecord('x_1865669_retrospe_retrospective_submission');
  if (retroGR.get(retroSysId)) {
    retroGR.status = 'reviewed';   // or 'reviewed' if you prefer
    retroGR.update();
  }

  outputs.tasks_created = tasksCreated;
})(inputs, outputs);

